import { Component  } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();
    this.state = {
      name : 'Torikus sadik'
    }
  }

  render() {
    return(
      <div className="App">
        <header className="App-header">

          <p>
            Assalamu alaikum, {this.state.name}
          </p>
          <button onClick={() => {
            this.setState({name: 'shakil Babu'})
          }}>
            Change Name
          </button>

          <button onClick={() => this.setState({name: 'Torikus sadik'})}>Back to previous name</button>

          <img src={logo} className = "App-logo" alt="logo" />
        </header>
      </div>
    );
  }
}

export default App;
